import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import HomePage from './components/HomePage';
import LoginSignUp from './components/LoginSignUp';
import Login from './components/Login';
import Register from './components/Register';
import DestinationsPage from './components/DestinationsPage';
import ToursPage from './components/ToursPage';
import ContactPage from './components/ContactPage';
import BookNowPage from './components/BookNowPage';
import DiscoverDestinationsPage from './components/DiscoverDestinationsPage';
import DashboardPage from './components/DashboardPage';
import StartJourneyPage from './components/StartJourneyPage';
import AboutUsPage from './components/AboutUsPage';
import './styles/tailwind.css'; // Import Tailwind CSS
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";

function App() {
    return (
            <Router>
                <div>
                    <Navbar />
                    <div style={{ paddingTop: '80px' }}>
                        <Routes>
                            <Route path="/" element={<HomePage />} />
                            <Route path="/loginsignup" element={<LoginSignUp />} />
                            <Route path="/login" element={<Login />} />
                            <Route path="/register" element={<Register />} />
                            <Route path="/destinations" element={<DestinationsPage />} />
                            <Route path="/tours" element={<ToursPage />} />
                            <Route path="/contact" element={<ContactPage />} />
                            <Route path="/booknow" element={<BookNowPage />} />
                            <Route path="/discover" element={<DiscoverDestinationsPage />} />
                            <Route path="/dashboard" element={<DashboardPage />} />
                            <Route path="/startjourney" element={<StartJourneyPage />} />
                            <Route path="/about-us" element={<AboutUsPage />} />
                            <Route path="*" element={<h1>404 Not Found</h1>} />
                        </Routes>
                    </div>
                </div> {/* Add missing closing div tag here */}
            </Router>
    );
}

export default App;
